import React, { useEffect, useState } from 'react';

import { getVersions } from '../../../api/version';
import './MyVersionsLeft.css';

import MyVersion from './MyVersion';

const MyVersionsLeft = () => {
	const [versions, setVersions] = useState([]);

	useEffect(() => {
		(async () => {
			const response = await getVersions();
			console.log('in useEffect 1', response);
			if (response.success && response.data > 0) {
				setVersions((prev) => {
					return [...response.data];
				});
			}
		})();
	}, []);

	useEffect(() => {
		console.log(versions);
	}, [versions]);
	return (
		<div className='my-versions-left' style={{ overflowY: 'scroll' }}>
			<h6>MY VERSIONS</h6>
			<table cellSpacing='0' cellPadding='0'>
				<thead>
					<tr>
						<th>Date</th>
						<th>Status</th>
						<th>Action</th>
					</tr>
				</thead>

				<tbody>
					{versions.map((vr) => {
						return (
							<MyVersion id={vr._id} date={vr.createdAt} status={vr.status} />
						);
					})}
				</tbody>
			</table>
		</div>
	);
};

export default MyVersionsLeft;
